const Portfolio = (props) => {
  return (
    <div
      className={
        props.activePortfolio
          ? "portfolio-cont active-portfolio"
          : "portfolio-cont"
      }
    >
      <div className={props.activePortfolio
          ? "portfolio active-portfolio"
          : "portfolio"
      }>

      </div>
    </div>
  );
};

export default Portfolio;
